package main

import (
	"fmt"
)

func lengthOfLongestSubstring(s string) int {
	l := len(s)
	var seen [128]bool // ASCII range 0-127
	var current, maxs, i, j int
	for i = 0; i < l; i++ {
		if seen[s[i]] {
			for s[i] != s[j] {
				seen[s[j]] = false
				j++
			}
			j++
			current = i - j + 1
		} else {
			seen[s[i]] = true
			current++
		}
		if current > maxs {
			maxs = current
		}
	}
	return maxs
}

